    (jet_tightId==1) & (jet_no<2) & (fj_pt>200) & (fj_pt<2500) & (fj_sdmass>=20) & (fj_sdmass<260) &
    (
      ((sample_isQCD==1) & (event_no%2==0)) |
      (sample_isQCD==0)
    )
